import React from 'react';
import './Navigation.css' 

const Navigation = ({onRouteChange, isSignedIn}) => {
	return (
		isSignedIn === true 
		? <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
			<p onClick={() => onRouteChange('signout')} className="dim link pointer">Sign Out</p>
		</nav>
		: <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
			<p onClick={() => onRouteChange('signin')} className="dim link pointer">Sign In</p>
			<p onClick={() => onRouteChange('register')} className="dim link pointer">Register</p>
		</nav>
	);
}

export default Navigation;
